measurements.description:
Nineteen starry flowers beautifully shingled on one 74-cm staked, upright inflorescence;
sepals cream blushed strong rose medially, more concentrated distally;
petals cream blushed rose medially, dotted deep rose central rib;
lip cream blotched burgundy, keels yellow blotched burgundy;
column superior surface cream blushed rose, stronger distally, inferior surface cream striped burgundy, anther cap cream;
 substance firm; texture matte.
